import React, { Component } from 'react';
import PropTypes from 'prop-types'
import "../App.css"

class TodoSubList extends Component {

    render() {
        return (
            <div className="item1-container">{this.props.todosublist.task}</div>
        )

    }

}


TodoSubList.propTypes = {
    todosublist: PropTypes.array.isRequired
}
export default TodoSubList;
